import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { ToastContainer } from "react-toastify";
import axios from "axios"; // Import Axios
import { handleError, handleSuccess } from "../utils";
import { Button } from "react-bootstrap";
function Login() {
  const [loginInfo, setLoginInfo] = useState({
    email: "",
    password: "",
  });

  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path); // Navigate to the desired route
  };
  const handleChange = (e) => {
    const { name, value } = e.target;
    console.log(name, value);
    const copyLoginInfo = { ...loginInfo };
    copyLoginInfo[name] = value;
    setLoginInfo(copyLoginInfo);
  };

  const handleLogin = async (e) => {
    e.preventDefault();
    const { email, password } = loginInfo;
    if (!email || !password) {
      return handleError("Email and password are required");
    }

    try {
      // const url = `https://deploy-mern-app-1-api.vercel.app/auth/login`;
      const url = `http://localhost:8080/auth/login`;
      // Replacing fetch with Axios
      const response = await axios.post(url, loginInfo, {
        headers: {
          "Content-Type": "application/json",
        },
      });

      const { success, message, jwtToken, name, error } = response.data;

      if (success) {
        handleSuccess(message);
        localStorage.setItem("token", jwtToken);
        localStorage.setItem("loggedInUser", name);
        setTimeout(() => {
          navigate("/home");
        }, 1000);
      } else if (error) {
        const details = error?.details[0]?.message || "An error occurred";
        handleError(details);
      } else if (!success) {
        handleError(message);
      }

      console.log(response.data);
    } catch (err) {
      console.error("Error during login:", err);
      handleError(err.response?.data?.message || "Internal server error");
    }
  };

  return (
    <Box>
      <TableContainer component={Paper} id="document-table">
        <Table aria-label="caption table" className="all-round-borders">
          <TableHead>
            <TableRow>
              <TableCell className="tableborder table-head-cell">
                Sr. No.
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="left">
                Job Title
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="left">
                Description
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="left">
                Status
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="center">
                Action
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {listData?.length > 0 ? (
              listData.map((item, index) => (
                <TableRow key={item._id || index}>
                  <TableCell className="text-start tableborder">
                    {(currentPageVal - 1) * limit + index + 1}
                  </TableCell>
                  <TableCell align="left" className="tableborder">
                    {item.name}
                  </TableCell>
                  <TableCell align="left" className="tableborder">
                    {item.description}
                  </TableCell>
                  <TableCell
                    align="left"
                    className="tableborder status-cell-width"
                  >
                    {item.isActive ? <Activepopover /> : <Inactivepopover />}
                  </TableCell>
                  <TableCell
                    align="center"
                    className="tableborder table-editcell"
                  >
                    <Box className="table-edit-del">
                      <ActionLink
                        isAuthorized={isPathInRoutes(
                          "/super-admin/edit-job-titles"
                        )}
                        to="/super-admin/edit-job-titles"
                        state={item._id}
                        unauthorizedTitle="Unauthorized Access"
                        label="Edit"
                        icon={<EditIcon />}
                      />
                      <Dropdown drop="start" autoClose="outside">
                        <Dropdown.Toggle
                          id="dropdown-autoclose-outside"
                          className="action-toggle-button"
                        >
                          <MoreVertIcon
                            className="dot-icon"
                            onClick={toggleClass}
                          />
                        </Dropdown.Toggle>
                        <Dropdown.Menu className="dropdown-menu">
                          <Dropdown.Item>
                            <ActionLink
                              isAuthorized={isPathInRoutes(
                                "/super-admin/edit-job-titles"
                              )}
                              to="/super-admin/edit-job-titles"
                              state={item._id}
                              unauthorizedTitle="Unauthorized Access"
                              label="Edit"
                              icon={<EditIcon />}
                            />
                          </Dropdown.Item>
                          <Dropdown.Item>
                            <ActionButton
                              isAuthorized={isPathInRoutes(
                                "/super-admin/delete-job-titles"
                              )}
                              onClick={() => deleteCheck(item._id)}
                              unauthorizedTitle="Unauthorized Access"
                              label="Delete"
                              icon={<DeleteOutlineIcon />}
                            />
                          </Dropdown.Item>
                        </Dropdown.Menu>
                      </Dropdown>
                    </Box>
                  </TableCell>
                </TableRow>
              ))
            ) : (
              <TableRow>
                <TableCell colSpan={5} align="center">
                  No data available.
                </TableCell>
              </TableRow>
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
}

export default Login;
